(198, 'Pitty', '\n                Muse.  Cresceu em meio ao cenário de bandas baianas independentes e participou de várias rodas de shows em um bar de Salvador.\n\n        ', 'http://userserve-ak.last.fm/serve/252/101476123.png', 1, '2523d1a88b5c1e20084a6d467cfdfeaf', 0, '7cb38ec6-00d2-42e2-9b32-913faaf6d175', 3, NULL),
(199, 'Pitty Sing', '', 'http://userserve-ak.last.fm/serve/252/368948.jpg', 1, '710d2a13950b4d8b1eff91c83f96fc31', 0, 'fafecff5-94bd-45b5-b2f6-e9addc1214bc', 3, NULL),
(200, 'Basshunter', '\n                Basshunter é o nome artístico do músico e DJ sueco Jonas Erik Altberg, nascido em (Halmstad, Suécia, em 22 de dezembro de 1984. Basshunter descreve sua própria música como eurodance, enquanto outros podem também interpretá-la como electro, dance music e outro gêneros de música eletrônica. Ele se tornou famoso por suas músicas Botten Anna (sobre um bot de IRC) e Vi Sitter I Ventrilo Och Spelar DotA (sobre o mod do jogo Warcraft III chamado DotA Allstars, presente no patch Frozen Throne), em parte relacionado às suas referências à cultura geek.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/76015408.png', 1, '010d34dfb3da37fb53769b52a4153fda', 0, '255e2420-5b02-452b-9771-0512ebe78090', 3, NULL),
(201, 'Bassnectar', '\n                Bassnectar (nome real Lorin Ashton), DJ e produtor com sede em Santa Cruz Califórnia. a maioria dos generos tocados por Lorin são Dubstep.  Ele é conhecido por suas performances ao vivo e espectáculos de luz, e apoia activamente o grupo sem fins lucrativos Consciente Alliance .Bassnectar, nascido Lorin Ashton, participou Belarmino Preparatória College, em San Jose, Califórnia. No Belarmino, Ashton foi fortemente influenciado por grupos de heavy metal, como Metallica e Megadeth. Ele pegou essas influências e encaixou em sua carreira musical.\n\n        Bassnectar on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/41240411.jpg', 1, 'dc2d9ad385e63dfd991fc6ab5c1186b6', 0, '5d7c4cfc-29e7-4c83-8893-ae02679fc9f4', 3, NULL),
(202, 'Racionais Mc''s', '\n                Um dos principais grupos de rap e hip hop brasileiros, surgiu no final da década de 80 na periferia de São Paulo com um discurso contra a opressão às populações marginalizadas nas grandes metrópoles brasileiras. A primeira gravação foi em 1988, na coletânea &quot;Consciência Black&quot;. Dois anos depois, o primeiro disco solo, &quot;Holocausto Urbano&quot; levou o grupo a fazer uma série de shows pela Grande São Paulo, tornando-o mais conhecido.\n\n        ', 'http://userserve-ak.last.fm/serve/252/309651.jpg', 1, 'dd7cadbce0d20402ed3567fdb8ab34f1', 0, '', 3, NULL),
(203, 'Cajun Dance Party', '\n                Cajun Dance Party são um quinteto de indie rock de Londres, Inglaterra, formado em 2005. Seus membros são Daniel Blumberg (vocais), Vicky Freund (teclados), Max Bloom (baixo), Robbie Stern (guitarra) e Will Vignoles (bateria), filho de músico clássico Roger Vignoles.\n \n\n        Cajun Dance Party on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/5641309.jpg', 1, '90b3dcd2b55f0ad43b0ef8b80226e8bd', 0, 'bb9b2f6f-0cdd-45e2-88b2-e04c13c3d4f6', 3, NULL),
