(239, '50 Cent', '\n                Curtis James Jackson III cresceu no bairro conhecido como South Jamaica, localizado no Queens, Nova York, Estados Unidos. O rapper foi criado pela mãe que abandonada tornou-se prostituta, sem a ajuda do pai. Ela foi encontrada morta ainda quando Curtis era criança, vivendo o resto de sua infância e adolescência com seus avós. No filme , o rapper conta que o nome 50 Cent foi inspirado em &quot;um garoto que fazia assaltos no Brooklyn&quot;.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/33594465.png', 1, 'd27e9ceac68a17257c85a4d433e7a4c8', 0, '8e68819d-71be-4e7d-b41d-f1df81b01d3f', 3, 'G-Unit,Lloyd Banks,The Game,Tony Yayo,Young Buck'),
