(244, 'TheOutfield', '', '', 1, '140b71c578e88051ed5781ab53ef30d2', 0, '', 3, ''),
(245, 'The Outfield', '\n                The Outfield é uma banda britânica de pop rock provinda de Londres (Inglaterra). Em 1985, lançaram seu primeiro álbum Play Deep, que atingiu o posto de disco triplo de platina nos Estados Unidos. Sua música de maior sucesso, inclusive tocada até hoje em muitas rádios é a intitulada Your Love. A banda continuou a gravar até o início da década de 90, tendo havido uma pausa em suas atividades nas proximidades da metade da década. Voltaram a fazer shows em 1998, e lançaram 2 álbuns ao vivo via Web site. O último álbum da banda, Any Time Now, foi lançado pela Sidewinder Records em março de 2006. \n\n        ', 'http://userserve-ak.last.fm/serve/252/27485863.jpg', 1, '4760122ac2b57a718c0d0961ded89e8f', 0, '5d400869-0471-42ee-afda-3addd73d0418', 3, 'Cutting Crew,Glass Tiger,Eddie Money,Mr. Mister,John Waite'),
