(257, 'Mötley Crüe', '\n                O Mötley Crüe foi oficialmente formado em 1981, quando o baixista Nikki Sixx e o baterista Tommy Lee resolveram largar suas bandas e iniciar um novo projeto. Posteriormente, juntaram-se à dupla o vocalista Vince Neil e o guitarrista Mick Mars, começando a banda a tocar em bares e casas noturnas locais de Hollywood. Sempre muito polêmico, o Mötley Crüe por muitas vezes chamou mais a atenção pelos escândalos que seus membros estiveram envolvidos do que propriamente pela música, sendo conhecidos até hoje como os &quot;bad boys of rock n'' roll&quot;. \n\n        ', 'http://userserve-ak.last.fm/serve/252/8501399.jpg', 1, '054b3d4e8d7ab15acb7acbafea85a5f3', 0, '26f07661-e115-471d-a930-206f5c89d17c', 3, 'Poison,L.A. Guns,Cinderella,Skid Row,Ratt'),
