(267, 'MÖTLEY CRÜE', '\n                Mötley Crüe (pronunciado ''mótlei crul'') é uma banda estadunidense de heavy metal criada em Los Angeles, Califórnia em 1981.\n A banda foi formada pelo baixista Nikki Sixx (que estava envolvido numa banda chamada London) e pelo baterista Tommy Lee, mais tarde entraram o guitarrista Mick Mars e o cantor Vince Neil. Mötley Crüe vendeu mais de 80 milhões de álbuns em todo o mundo.\n Freqüentemente, a banda é conhecida pelo estilo de vida de seus integrantes: Todos tem muitas passagens pela polícia, passando tempos na cadeia por conta de seus vícios em bebidas, drogas e por fugirem com mulheres.\n\n        ', 'http://userserve-ak.last.fm/serve/252/93833949.jpg', 1, '06b265c154b219686b62784bf90957e6', 0, '', 3, ''),
(268, 'MÖTLEY CRÜE', '\n                Mötley Crüe (pronunciado ''mótlei crul'') é uma banda estadunidense de heavy metal criada em Los Angeles, Califórnia em 1981.\n A banda foi formada pelo baixista Nikki Sixx (que estava envolvido numa banda chamada London) e pelo baterista Tommy Lee, mais tarde entraram o guitarrista Mick Mars e o cantor Vince Neil. Mötley Crüe vendeu mais de 80 milhões de álbuns em todo o mundo.\n Freqüentemente, a banda é conhecida pelo estilo de vida de seus integrantes: Todos tem muitas passagens pela polícia, passando tempos na cadeia por conta de seus vícios em bebidas, drogas e por fugirem com mulheres.\n\n        ', 'http://userserve-ak.last.fm/serve/252/93833949.jpg', 1, '06b265c154b219686b62784bf90957e6', 0, '', 3, ''),
(269, 'MÖTLEY CRÜE', '\n                Mötley Crüe (pronunciado ''mótlei crul'') é uma banda estadunidense de heavy metal criada em Los Angeles, Califórnia em 1981.\n A banda foi formada pelo baixista Nikki Sixx (que estava envolvido numa banda chamada London) e pelo baterista Tommy Lee, mais tarde entraram o guitarrista Mick Mars e o cantor Vince Neil. Mötley Crüe vendeu mais de 80 milhões de álbuns em todo o mundo.\n Freqüentemente, a banda é conhecida pelo estilo de vida de seus integrantes: Todos tem muitas passagens pela polícia, passando tempos na cadeia por conta de seus vícios em bebidas, drogas e por fugirem com mulheres.\n\n        ', 'http://userserve-ak.last.fm/serve/252/93833949.jpg', 1, '06b265c154b219686b62784bf90957e6', 0, '', 3, ''),
(270, 'Os Paralamas Do Sucesso', '\n                Um dos mais tradicionais grupos de rock brasileiro em atividade, Os Paralamas do Sucesso começaram a tocar juntos no começo dos anos 80 em Brasília.  Conheceram-se no Rio de Janeiro em 1981 e, junto com Vital Dias, começaram a ensaiar. Quando finalmente conseguiram uma apresentação num festival universitário, o baterista Vital não compareceu. Preocupados com essa situação, os outros dois integrantes saíram atrás de um substituto e foram apresentados a João Barone por um amigo em comum. Barone tocou com eles nesse dia, e o trio nunca mais se separou. \n\n        ', 'http://userserve-ak.last.fm/serve/252/395928.jpg', 1, 'cd8ecd59b981da66e8c012f1888e2669', 0, 'f197a8df-ac2b-4e78-9913-4abf13741f12', 3, 'Herbert Vianna,Titãs,Skank,Barão Vermelho,Capital Inicial'),
(271, 'Marisa Monte & Paralamas do Sucesso', '', 'http://userserve-ak.last.fm/serve/252/24396583.jpg', 1, '0ace0e5f54b8429a6ca3b64089f4e6b5', 0, '', 3, ''),
(272, 'Paralamas do Sucesso & Titãs', '\n                Os Paralamas do Sucesso (Herbert Vianna, Bi Ribeiro e João Barone) e os Titãs (Branco Mello, Charles Gavin, Paulo Miklos, Sérgio Britto e Tony Bellotto) se juntaram para uma turnê comemorativa dos 25 Anos de Rock das bandas.  &quot;As duas bandas sempre tiveram afinidade também extra-musical&quot;, diz Branco Mello. &quot;A gente sempre bateu bola. Eu subia na bateria do Charles e tocava sem cerimônia. Ia lá e descia a botina. O Herbert já arrebentou muita corda de guitarra do Fromer&quot;, afirma Barone.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/8636125.jpg', 1, '9a8829e58b23288dad32864acbe59e55', 0, '', 3, ''),
(273, 'Titas & Paralamas do Sucesso', '', '', 1, '7cc48471080565e4e759fcda9c94eb7c', 0, '', 3, 'Rita Lee & Marisa Monte,Titas & Marisa Monte,Chico Buarque e Caetano Veloso,Leoni & Herbet Viana,Laranja Freak'),
(274, 'Frejat e Paralamas do Sucesso', '', 'http://userserve-ak.last.fm/serve/252/43510321.jpg', 1, 'a63f36b4a3218941b691d540b7614fee', 0, '', 3, 'Skank & Nando Reis Milton Lou,Cássia Eller, Adriana Calcanhoto, Marisa Monte e Ana Carolina,Leoni & Herbet Viana,Skank & Jota Quest,Cazuza e Lenine'),
(275, 'Os Paralamas do Sucesso e Titãs', '\n                Os Paralamas do Sucesso (Herbert Vianna, Bi Ribeiro e João Barone) e os Titãs (Branco Mello, Charles Gavin, Paulo Miklos, Sérgio Britto e Tony Bellotto) se juntaram para uma turnê comemorativa dos 25 Anos de Rock das bandas.   A idéia não é nova: em 1992, os dois grupos fecharam a última noite do Hollywood Rock, no que Herbert Vianna considerou um dia histórico, já que não é muito comum que bandas brasileiras encerrem grandes festivais no Brasil.\n  \n \n\n        ', 'http://userserve-ak.last.fm/serve/252/38624759.jpg', 1, 'e981da5ddf4592d55bb4a7e67a11bfc1', 0, '', 3, ''),
(276, 'Os Paralamas Do Sucesso & Titãs', '\n                Paralamas e Titãs Juntos e Ao Vivo é um álbum ao vivo das bandas brasileiras Os Paralamas do Sucesso e Titãs, lançado em 2008.\n Gravado na Marina da Glória, no Rio de Janeiro, em Janeiro de 2008, o disco marca as comemorações dos 25 anos de carreira de ambas as bandas, trazendo vários sucessos como Sonífera Ilha, Diversão, Meu Erro, O Calibre, Go Back, Trac-Trac, entre outras canções.\n Participam como convidados o guitarrista Andreas Kisser, do Sepultura...\n\n        ', 'http://userserve-ak.last.fm/serve/252/48049737.jpg', 1, '1eabc3a2365ba9c631d1f10a96622163', 0, '', 3, 'Charlie, Detonautas, Pitty, CPM 22, O Rappa,Cássia Eller, Adriana Calcanhoto, Marisa Monte e Ana Carolina,Titãs e Marisa Monte,Skank & Nando Reis Milton Lou,Skank & Jota Quest'),
