(278, 'Outkast', '\n                OutKast é uma dupla de cantores de hip hop de Atlanta, Geórgia formada por André Lauren Benjamin (Andre 3000)e Antwan André Patton (Andre 3000 é o lado mais sensível e divertido da dupla Outkast. Seu estilo musical original foi uma mistura de elementos de Dirty South e G-Funk; desde lá, funk, soul, eletrônica, rock, Rap, crunk, jazz e blues, que foram adicionados à mistura.  OutKast é um dos grupos de hip-hop mais bem sucedidos de todos os tempos, tendo vendido mais de 20 milhões de cópias de seus sete álbuns: seis álbuns de studio...\n\n        ', 'http://userserve-ak.last.fm/serve/252/30800397.jpg', 1, '0b7e5b0b78d517a3851fbd07b718b1d2', 0, '73fdb566-a9b1-494c-9f32-51768ec9fd27', 3, 'Big Boi,Clipse,Kanye West,Big K.R.I.T.,UGK'),
