(286, 'Galo Frito', '\n                Em meados de 2006, Mederijohn Corumbá (Mederi) e Guilherme Angeli resolveram bolar um programa de humor diferente, usando esquetes em forma de curtas-metragens de humor. Assim nasceu o Galo Frito. Quando tudo estava definido, infelizmente Guilherme Angeli veio a falecer, fazendo com que o Galo Frito ficasse na geladeira por cerca de 6 meses.  Não querendo deixar o projeto acabar, em 2007 Mederi chama o Tiago Cadore (Cadore) para fazer parte do elenco Galo Frito, assim fazendo um piloto.\n\n        ', 'http://userserve-ak.last.fm/serve/252/88948043.png', 1, '434949d14647bef9a50f4b02b0b8c6ff', 0, '', 3, 'Mederijohn Corumbá,Celldweller(Remixed by Growling Machines),Celldweller(Remixed by Vibe Tribe),D''Azzo,Paranormal Attack-Walking in The Sun'),
