(288, 'Jason Derülo', '\n                Ator, Cantor, Compositor, Coreógrafo e Dançarino nascido na Flórida, no dia 21 de Setembro de 1989, Jason Desrouleaux mais conhecido como Talk Dirty”, está em tournê de divulgação do mesmo.   \n\n        ', 'http://userserve-ak.last.fm/serve/252/91464561.png', 1, 'baf18b1431a27438b56c884a9bbb644a', 0, '', 3, 'Taio Cruz,Jay Sean,Chris Brown,Pitbull,Flo Rida'),
