(293, 'Emicida', '\n                Leandro Roque de Oliveira (São Paulo, 17 de agosto de 1985), mais conhecido pelo seu nome artístico Emicida é um rapper, repórter e produtor musical brasileiro. É considerado uma das maiores revelações do hip hop do Brasil nos últimos anos. O nome &quot;Emicida&quot; é uma fusão das palavras &quot;MC&quot; e &quot;homicida&quot;. Por causa de suas constantes vitórias nas batalhas de improvisação, seus amigos começaram a falar que Leandro era um &quot;assassino&quot;, e que &quot;matava&quot; os adversários através das rimas.  Mais tarde, o rapper criou também uma conotação de sigla para o nome: E.\n\n        ', 'http://userserve-ak.last.fm/serve/252/60945171.png', 1, '748b7e66f7bd58f4d5f15c3501c355a4', 0, '7b874216-914f-4f77-b5c4-70f6ff8052ad', 3, 'Rashid,Emicida, Beatnick e K-Salaam,Rael,Kamau,Criolo e Emicida'),
(294, 'Emicida, Beatnick e K-Salaam', '\n                Doozicabraba e a Revolução Silenciosa:  A produção foi ostentada pela dupla norte-americana K-Salaam &amp; Beatnick nas batidas, em uma colaboração com o grupo The Studio. O EP também inclui diversas participações de interpretes do mundo do hip hop, como os nomes Rael da Rima, Fióti, Don Pixote e do carioca MV Bill. Musicalmente e EP mostra um Emicida mais brando vocalmente, porém se mantendo no estilo lírico de seus trabalhos anteriores, tomando como principais temas suas dificuldades e relacionamentos ao longo da carreira de modo observador.\n\n        ', 'http://userserve-ak.last.fm/serve/252/67151458.jpg', 1, '9a0a53350749a418451f4d2f65f5b42d', 0, '', 3, 'Emicida,Rael da Rima,Criolo e Emicida,Rael,Rashid'),
(295, 'Criolo e Emicida', '\n                Dois grandes nomes do rap nacional anunciaram o lançamento de um CD e DVD conjunto, intitulado Criolo e Emicida - Ao Vivo. O trabalho foi gravado em setembro de 2012 no Espaço das Américas, em São Paulo. A apresentação foi gravada com 40 microcâmeras espalhadas pelos instrumentos e palco, com direção de Paula Lavigne. A turnê de divulgação passa pelas principais capitais do país a partir de julho de 2013.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/91212347.jpg', 1, '3cd950da5d55037f35d0df1754c68694', 0, '', 3, 'Ogi,Cacife Clandestino,Wado,3030,Karol Conká'),
