(301, 'Mc Guime', '\n                Guilherme Aparecido Dantas (Osasco, 10 de dezembro de 1992) mais conhecido como MC Guimê é um cantor e compositor de funk ostentação brasileiro. Ficou conhecido pela sua primeira canção de trabalho &quot;Tá Patrão&quot;, em seguida lançou vários outros singles que o levaram à grande mídia como, &quot;Plaquê de 100&quot;, &quot;País do Futebol&quot; e &quot;Na Pista, Eu Arraso&quot;. Atualmente é considerado o maior nome do Funk ostentação.\n\n        Mc Guime on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/89879239.png', 1, '7540a3de7fd972a81ea684b391f59a51', 0, '', 3, 'Mc Daleste,MC Lon,Mc Gui,MC Bola,Mc Magrinho'),
(302, 'MC Guimê', '\n                Guimê, cantor de &quot;Funk ostentação&quot; diferente do funk tradicional que falava sobre as comunidades pobres. O MC Guimê em suas músicas fala sobre carro, roupa de grife, perfume importado, dinheiro e jóias. Ganhou uma grande notoriedade com as músicas, &quot;Tá Patrão&quot; e &quot;Plaque de 100&quot;, com o videoclipe da música &quot;Plaque de 100&quot;, foi um dos clipes musicais mais visto em 2012 com mais de 30 milhões de acessos no YouTube.\n\n        MC Guimê on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/96923167.png', 1, '633d8de687e17b369a734c2d42325c9d', 0, 'f1e9caee-48a2-4b2c-b26d-cb7d4a19d5f4', 3, 'MC Bola,Mc Nego Blue,Pikeno e Menor,MC Livinho,MC Pedrinho'),
