(311, 'Jimmy Cliff', '\n                Jimmy Cliff, nome artístico de James Chambers, (Saint Catherine, 1 de abril de 1948) é um músico jamaicano de reggae. É o menos compreendido de todos os grandes mestres do reggae, tendo sido acusado de abandonar as origens rastas, porém é respeitado por ter sido o primeiro a abrir as portas do sucesso ao reggae na Europa e no resto do mundo.  A sua religião lhes causou muitos problemas na Jamaica com os rastas. Num incidente estranho, em um grande show com os Wailers em Kingston nos finais de 1975, rastas radicais, indignados com sua dedicação ao islamismo, chegaram a cuspir em sua cara.\n\n        ', 'http://userserve-ak.last.fm/serve/252/27736519.jpg', 1, 'be72e4c81b67d97b4c289bfb7b3108ab', 0, '2caa54a7-b08c-41da-b892-3a41abe778be', 3, 'Toots and The Maytals,Peter Tosh,Eric Donaldson,The Melodians,Third World'),
