(319, 'Maroon 5', '\n                Los Angeles, Califórnia (1998 – presente)  Maroon 5 é uma banda de pop rock dos Estados Unidos, com influências do soul, funk e R&amp;B. É formada por Adam Levine, James Valentine, Jesse Carmichael, Mickey Madden, Matt Flynn.  A história do Maroon 5 começou na época do colegial, em Los Angeles, na Califórnia. Os integrantes eram amigos, tinham 17 anos, e resolveram montar uma banda, inicialmente chamada de Kara''s Flowers.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/89687701.jpg', 1, '24c0ec968688c7aad6c2a2ce05124fbd', 0, '0ab49580-c84f-44d4-875f-d83760ea2cfe', 3, 'The Script,OneRepublic,Adam Levine,Bruno Mars,Justin Timberlake'),
(320, 'Maroon 5 feat. Christina Aguilera', '', 'http://userserve-ak.last.fm/serve/252/89338191.jpg', 1, '1e0706753c4f83ea90b10a8ad5b5de46', 0, '', 3, 'One-T & Cool-T,VA - www.musicasparabaixar.org,Niknot Radio,NewThingRadioWeb,Ben E. Kings vs. The Police'),
(321, 'Maroon 5 feat Christina Aguilera', '', 'http://userserve-ak.last.fm/serve/252/103681235.png', 1, 'a5aaa726cd857d0767f13bcc51097825', 0, '', 3, 'Fun feat Janelle Monáe,Maroon 5 feat Wiz Khalifa,♪ ♫ Maroon 5,Pitbull feat. Jennifer Lopez & Claudia Leitte,♪Lana Del Rey'),
(325, 'Maroon 5 & Lady Antebellum', '', 'http://userserve-ak.last.fm/serve/252/52433231.jpg', 1, 'bac79a10fa16b53fca73183fa8a44018', 0, '', 3, ''),
(326, 'Maroon 5 Feat. Lady Antebellum', '', 'http://userserve-ak.last.fm/serve/252/52975495.jpg', 1, 'fc949295894847456bb967c17f7dee8f', 0, '', 3, 'B.o.B feat. Rivers Cuomo,Simple Plan Feat. K''naan,P!NK feat. Peaches,David Guetta & AfroJack Feat. Timbaland & Dev,Justin Bieber feat. Sean Kingston'),
(327, 'Akon', '\n                Aliaune Badara Akon Thiam, mais conhecido como Akon. É um famoso rapper, compositor, e produtor musical, nasceu em Dakar, Senegal, no dia 30 de Abril de 1973.\n Chegou à fama em 2004 na sequência do lançamento de seu single &quot;Locked Up&quot; a partir de seu álbum de estréia Trouble. Seu segundo álbum, Konvicted, ganhou uma nomeação para o Grammy Award junto com o single &quot;Smack That&quot;. É o fundador da Konvict Muzik e Kon Live Distribution.\n \n\n        ', 'http://userserve-ak.last.fm/serve/252/17313515.jpg', 1, 'ac6b00dec130960b92aadf44de37df21', 0, '1138a764-2212-4d0a-b02d-0dc14df91e08', 3, 'Sean Kingston,Jay Sean,T-Pain,Iyaz,Kardinal Offishall'),
(328, 'Akon feat. Snoop Dogg', '\n                Aliaune Badara Akon Thiam,[1] mais conhecido como Akon, (St. Louis, 30 de abril de 1973)[2][3] é um cantor de R&amp;B e hip hop americano de origem senegalesa e wolof[4], também é compositor, rapper e produtor musical. Akon chegou à fama em 2004 após o lançamento de seu single &quot;Locked Up&quot;, do seu álbum de estreia Trouble. Seu segundo álbum, Konvicted, foi indicado para o Grammy Award juntamente com o single &quot;Smack That&quot;. Ele é o fundador da Konvict Muzik e Kon Live Distribution.\n\n        ', 'http://userserve-ak.last.fm/serve/252/35586467.png', 1, 'e1567a633800ebdbacd8302b7d354fa6', 0, '', 3, 'Akon,50 Cent & Snoop Dogg & G-Unit,50 Cent feat. Justin Timberlake & Timbaland,Эльбрус Джанмирзоев,Tyga Feat. Lil Wayne'),
(330, 'Akon feat. Kardinal Offishall', '', 'http://userserve-ak.last.fm/serve/252/19284145.jpg', 1, '68f081d97e7ed8a219ba2c545d6f05da', 0, '', 3, 'Akon Feat. AC,Akon Feat. Romeo,Akon Feat. JL, Tami Chynn,Akon Feat. Colby O Donis,Akon Feat. Fabolous & Fat Joe'),
(331, 'Akon ft Snoop Dogg', '', 'http://userserve-ak.last.fm/serve/252/187643.jpg', 1, 'cb3dab2611905d6f2240bf8624602b3b', 0, '', 3, 'Bow Wow feat. Chris Brown,T-Pain Feat. Young Joc,Akon feat. Obie Trice,Chris Brown feat. Lil Wayne,Bubba Sparxxx ft. Ying Yang Twins'),
(332, 'David Guetta', '\n                David Guetta nasceu e cresceu em Paris. Seu pai era um restaurador. No início de 1980, aos 13 anos, começou a misturar seus vinis originais em casa e, em seguida, aos 14, começou a organizar festas em seu porão, vindo a começar a carreira profissional aos 17 anos quando tocava Hip-Hop e House Music em Boates de Paris.  Em 2001, Guetta e Chris Willis e produzido por Garraud.\n\n        ', 'http://userserve-ak.last.fm/serve/252/45807247.png', 1, 'd0394a7075e30b98515109ff17e970ab', 0, '1bb1eec6-88c3-4028-8920-a985c4b9081a', 3, 'Calvin Harris,Jack Back,Avicii,Pitbull,David Guetta & Afrojack'),
(333, 'David Guetta vs The Egg', '\n                David James Guetta, mais conhecido como David Guetta (Paris, 7 de novembro de 1967) é um DJ francês, de ascendência judaica marroquina. Em 2005, seu single &quot;The World Is Mine&quot;, que contém uma amostra dos Simple Minds &quot;Someone Somewhere In Summertime&quot;, liderou as paradas de dança europeia. Vocal para suas canções têm sido realizados por uma variedade de artistas notáveis, incluindo Chris Willis, Cozi Costi, Kelly Rowland, Akon e will.i.am.\n\n        ', 'http://userserve-ak.last.fm/serve/252/36286155.jpg', 1, 'dcb40e80b86a112d224d69cf2253d7c9', 0, '', 3, 'Cleaners The,David Guetta & Chris Willis ft Fergie & LMFAO,Bazzheadz,Richard Vission,Superpumas'),
(334, 'Flo Rida feat. David Guetta', '', 'http://userserve-ak.last.fm/serve/252/51742919.jpg', 1, '3a5cef0d1e426ad2c4aa73de6f07953f', 0, '', 3, 'Pitbull feat. Chris Brown,Pitbull feat. Christina Aguilera,Jay-Z Feat. Alicia Keys,Maroon 5 feat. Christina Aguilera,Flo Rida'),
