(339, 'David Guetta & Showtek', '', 'http://userserve-ak.last.fm/serve/252/103815105.png', 1, 'a23c68353d5194fb3c17529200bd3800', 0, '43697d0d-1ff7-430c-a904-0db0b40feb9f', 3, 'Calvin Harris & Firebeatz,Calvin Harris & Ummet Ozcan,Calvin Harris & R3hab,David Guetta & Kaz James,David Guetta'),
(340, 'Ian Carey', '\n                Ian Carey é um DJ norte-americano de house/eletrônica. Ele já vendeu mais de 1 milhão de gravações em todos os formatos, já tocou em todos os continentes do mundo, desde a Tailândia até o Canadá, da Rússia à Ucrânia, Japão, Austrália, África do Sul, América do Sul e, por toda a Europa e América do Norte.  Carreira  O DJ é residente da Defected Records nas noites de house e também do evento Hed Kandi Clubnights em diferentes lugares ao redor do mundo. Sua discografia, selos associados e parcerias o tornaram um convidado VIP para o Miami Winter Music Conference InParty. \n\n        ', 'http://userserve-ak.last.fm/serve/252/66565178.jpg', 1, 'df21b243666eda86c7188418e591c6ea', 0, '386df5e4-aa80-412f-aa31-7a201f0ed678', 3, 'Laurent Wolf,Alex Gaudino,Michael Mind,Antoine Clamaran,Yves Larock'),
(341, 'The Ian Carey Project', '\n                Ian Carey, (13 de setembro de 1975) é um DJ norte-americano de house/eletrônica. Ele já vendeu mais de 1 milhão de gravações em todos os formatos, já tocou em todos os continentes do mundo, desde a Tailândia até o Canadá, da Rússia à Ucrânia, Japão, Austrália, África do Sul, América do Sul e, por toda a Europa e América do Norte. Ele já remixou sons para renomados selos como Defectec Records, Stealth Records, Fluential Records, Manifesto Records, Eye Industries, Ministry of Sound, Hed Kandi, Universal Music, EMI e, além de seu próprio selo SFAB RecordËlan Recordings.\n\n        ', 'http://userserve-ak.last.fm/serve/252/53491921.jpg', 1, 'b441baef6700be97ddfca9016702b721', 0, 'e81f5254-d5ac-4e55-a901-342cb5940aa4', 3, 'Ian Carey,Michael Mind,The Potbelleez,Booty Luv,Alex Gaudino'),
