(348, 'Lady Gaga', '\n                Stefani Joanne Angelina Germanotta (Nova York, 28 de Março de 1986), mundialmente famosa por seu nome artístico Lady GaGa, é cantora, compositora e produtora musical. Começou a se apresentar no cenário musical de Interscope Records.\n\n        ', 'http://userserve-ak.last.fm/serve/252/104254959.png', 1, 'f4a1462da44612fd2c5e1adc4fb7842c', 0, '650e7db6-b795-4eb5-a702-5ea2fc46c848', 3, 'Tony Bennett & Lady Gaga,Natalia Kills,Ke$ha,Marina & the Diamonds,Nicki Minaj'),
(349, 'Tony Bennett & Lady Gaga', '\n                Duets II. Bennett e Gaga lançaram seu primeiro álbum em colaboração &quot;Cheek To Cheek&quot; no dia 23 de Setembro de 2014 e instantaneamente se tornou um sucesso ficando no topo do Itunes em vários países do mundo.   \n\n        ', 'http://userserve-ak.last.fm/serve/252/102071761.png', 1, '72a1e80c9c21bce47c3feee3fbfb43da', 0, '', 3, 'Lady Gaga,Azealia Banks,Michael Jackson vs Lady Gaga,Nicki Minaj,Marina & the Diamonds'),
(350, 'Lady GaGa Feat. Beyoncé', '\n                Ajeitem suas tags... Quer escutar ''Telephone''?? Coloque no artista &quot;Lady GaGa&quot; e na música &quot;Telephone (feat. Beyonce)&quot;.\n\n        Lady GaGa Feat. Beyoncé on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/60723043.png', 1, 'b6e093dca5aaa17d1ed2ef978c7e2b53', 0, '', 3, 'Lady Gaga,Madonna feat. Justin Timberlake & Timbaland,Maroon 5 feat. Christina Aguilera,Tony Bennett & Lady Gaga,LMFAO feat. Lauren Bennett & GoonRock'),
(351, 'Lady Gaga & Beyoncé', '\n                &quot;Telephone&quot; é uma canção da cantora Lady Gaga para o terceiro EP, The Fame Monster. Conta com a participação de Beyoncé e foi lançado como segundo single do disco de Gaga, posteriormente à sua entrada em tabelas musicais de alguns países, nomeadamente no Canadian Hot 100. Inicialmente oferecida à cantora Britney Spears, a inspiração para a canção foi o medo de sufocamento de Gaga, e do facto de que raramente encontrou tempo para se divertir.\n\n        ', 'http://userserve-ak.last.fm/serve/252/43402059.png', 1, '872c50ec0d6c905939b2931d960eb372', 0, '', 3, 'Lady Gaga,Tony Bennett & Lady Gaga,Beyoncé & Shakira,DJ White Shadow,Nicki Minaj'),
(352, 'Wale feat. Lady Gaga', '\n                &quot; Chillin &quot;é uma canção do rapper americano Wale . A canção apresenta a cantora Lady Gaga e serve como o primeiro single de seu álbum de estréia, Atenção: Déficit . Foi lançado oficialmente em 12 de junho de 2009. Um remix da canção está presente no Wale, Voltar para o recurso mixtape, sob o nome de &quot;Chillin (Catch vs 9)&quot;.\n A canção recebeu críticas mistas dos críticos contemporâneos. &quot;Chillin&quot; chegou às regiões mais baixas das tabelas oficiais de algumas das nações.\n\n        ', 'http://userserve-ak.last.fm/serve/252/95766855.png', 1, '4e3365d440385975a2e7423c3d77e91e', 0, '', 3, 'Lady Gaga,► LADY GAGA,Антон Беляев и Алёна Тойминцева,Violeus,Locksley'),
(353, 'Lady Gaga & Rhianna', '', 'http://userserve-ak.last.fm/serve/252/39094959.png', 1, 'dcb2f1611e9f3f523f4f2846c654e699', 0, '', 3, 'Akon ft. David Guetta, Lady Gaga & Fatman Scoop,Flo-Rida ft. Nelly Furtado,Flo-Rida Ft. Will.I.Am and Fergie,Lady Gaga & Rihanna,Mariah Carey, Beyoncé, Mary J. Blige, Rihanna, Fergie, Sheryl Crow, Melissa Etheridge, Natasha Beddingfield, Miley Cyrus, Leon'),
(354, 'Lady Gaga, Cartman, ZKM', '', 'http://userserve-ak.last.fm/serve/252/39126459.jpg', 1, '09ce9292712e3071c1e103aa0f09f589', 0, '', 3, 'Protivo Gunz,Баста И Город 312,Николай Воронов,Timmy and the Lords of the Underworld,Вася Обломов feat. Ленинград'),
(355, 'Lady GaGa Ft. Beyoncé', '\n                Misture um pouco de talento + vocais perfeitos + sensualidade + beleza + dedicação + originalidade, você chegará a uma das músicas mais bem elaboradas e viciantes que o mundo já ouviu. Todos já previam (ou não) o que ia dá quando Lady Gaga está por perto, mas a ''Honey B'' também fez sua parte na música e no clipe.\n\n        Lady GaGa Ft. Beyoncé on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/59025241.jpg', 1, '27c03fbf90d8d1d8af72b1d2e8af22fb', 0, '', 3, 'Alicia Keys ft. Beyoncé,Timbaland Ft. Nelly Furtado & SoShy,Timbaland Ft. SoShy & Nelly Furtado,Jay-Z Ft. Beyoncé,Give Me Everything Tonight'),
(356, 'Supercombo', '\n                Surgido em meados de 2003, o Supercombo traz uma proposta de som completamente desprendido de rótulos, mas sem o medo de soar popular. A espera de quase quatro anos para o lançamento do primeiro registro, “Festa?”, os integrantes absorvem ainda a maior diversidade de influências possíveis para criar um estilo de som característico.  Em fase de pré-lançamento, o CD “Festa?” que foi produzido por Sérgio Benevenuto e mixado no estúdio The Village em Tring...\n\n        ', 'http://userserve-ak.last.fm/serve/252/70652004.png', 1, '9d8cc101e6b933e6fba40424bb0e9c6b', 0, 'd08fb778-e4d5-41ba-85ab-9c458c9bd152', 3, 'Pullovers,Banda do Mar,Castello Branco,Suricato,Rubel'),
(357, 'Supercombo/', '', '', 1, '81e8900959a7dbbb60d66394a5093060', 0, '', 3, 'De Janeiro A Janeiro'),
