(359, 'SUPERCOMBO 1', '', '', 1, '15a5e46bc0d9a706a941a2647ab1be6f', 0, '', 3, ''),
(360, 'Supercombo Veracruz', '', '', 1, 'a3399acbd906cb3736c9f8a875361798', 0, '', 3, ''),
(361, 'Supercombo e Scalene', '\n                Depois de tocarem juntos em Curitiba e São Paulo, as bandas Supercombo e Scalene se juntaram em estúdio e lançam o single Trans-Aparecer.  &quot;Foram dois dias bem intensos e o mais legal disso foi que deu pra galera se conhecer melhor, já que logo na semana seguinte a gente iria fazer dois shows juntos&quot;, conta Pedro Ramos, guitarrista do Supercombo.  Pedro conta ainda que Trans-Aparecer, que teve mixagem e masterização feitas por Leo Ramos (vocalista do Supercombo), é um &quot;presente de Natal para quem acha que não tem ninguém fazendo rock no Brasil&quot;. \n\n        ', 'http://userserve-ak.last.fm/serve/252/102737159.jpg', 1, '361ee7877839d6277e01f9122687ca2e', 0, '', 3, 'Gustavo Bertoni,Scalene,Supercombo,Scalene e Far From Alaska,O Amor Existe'),
