(364, 'The Kooks', '\n                The Kooks é uma banda britânica de indie rock formada em Brighton em 2004. A banda foi formada no colégio onde todos estudavam, Hoover High School. O vocalista e guitarrista Kooks&quot;.\n\n        ', 'http://userserve-ak.last.fm/serve/252/343014.jpg', 1, 'b644b234f2d86da8b2804207e42138fe', 0, 'c41c6a32-cd7e-4cce-8859-559efdd457b3', 3, 'Arctic Monkeys,Two Door Cinema Club,Jake Bugg,Foster the People,The Strokes'),
