INSERT INTO `Artista` (`ArtistaId`, `Titulo`, `Descricao`, `Imagem`, `Ativo`, `md5`, `Visitas`, `mbid`, `AplicacaoId`, `Relacionados`) VALUES
(372, 'Marcelo D2', '\n                Marcelo D2 nasceu em 5 de novembro de 1967, na zona norte do Rio de Janeiro. Carioca da gema quente dos bairros dos vales da cidade, escondido dos cartões postais e longe das calçadas ricas da beira-mar. Moleque ativo criado entre o morro e o asfalto do Andaraí, transitando na linha fina que separa um garoto de cair na marginalidade.  Trabalhando e se virando desde os 13 anos, D2 é um daqueles casos de menino que nasce com uma estrela latejante de talento e “sagacidade”. Foi porteiro, camelô, faxineiro, entregador de jornais, vendedor de móveis, office boy.\n\n        ', 'http://userserve-ak.last.fm/serve/252/33666663.jpg', 1, '89cb8c8c945b0e2319bbdec3d8a5f634', 0, '8c1f7395-61b6-43bf-bb62-55d2c669f0e0', 3, 'Planet Hemp,ConeCrewDiretoria,Oriente,Black Alien,Emicida'),
(373, 'Lenine e Marcelo D2', '\n                O Estúdio Coca-Cola é um programa veiculado na MTV, exibido todo último domingo do mês pelo canal e que promove encontros musicais inusitados. Artistas de universos sonoros diferentes encontram-se no palco pela primeira vez e gravam uma apresentação especial. Além do show dos músicos, o MTV Especial: Estúdio Coca-Cola mostra toda a concepção do espetáculo e a criação de algo ainda mais forte do que o talento individual de cada artista.\n\n        ', 'http://userserve-ak.last.fm/serve/252/353670.jpg', 1, 'ffb2983e0a3fb8ab1f452f754e22919f', 0, '', 3, 'Lenine & Lula Queiroga,Negra Li e Pitty,Skank e Nação Zumbi,Babado Novo e CPM 22,Armandinho e NX Zero'),
