(380, 'Garotos Podres', '\n                Influenciados pelas bandas punks do final dos anos 70 e início dos anos 80, o grupo foi formado em 1982 na cidade de Mauá (uma das cidades que compõem a região do Grande ABC, em São Paulo). Naquela época estávamos no auge do movimento punk no Brasil e várias bandas surgiam principalmente nos grandes centros urbanos. A primeira apresentação dos Garotos aconteceu em 1983 na cidade de Santo André num evento que reuniu vários grupos de vários estilos musicais em prol do Fundo de Greve dos Metalúrgicos do ABC, daí para frente começaram a participar de vários eventos pela região.\n\n        ', 'http://userserve-ak.last.fm/serve/252/523275.jpg', 1, '729eb7cfaa0d3f471f216eb72e7621b4', 0, '3213d371-83f3-4469-8f24-72564f1640e1', 3, 'Cólera,Inocentes,Gritando HC,Os Replicantes,Calibre 12'),
