(383, 'Submundo (Pré Garotos Podres)', '\n                Primeira Bando do vocalista Mao dos Garotos Podres, o Submundo foi uma banda brasileira de punk rock, formada em Santo André em 1980.  Historia, \n O Submundo foi formado em 1980 com os seguintes integrantes: Ricardo (bateria) ,Mao (vocal), Zé Renato (guitarra) e Nelson (baixo).  Em 1981 já com Hamilton no baixo gravam uma demo-tape, que conta com as músicas &quot;Batman&quot;, &quot;Verme&quot;, &quot;Johnny&quot; e &quot;Vomitaram no Trem&quot;, que mais tarde seriam regravadas pelos Garotos Podres.[1]  \n\n        ', '', 1, '07b9c11cbfce2b9224e8256873325ca6', 0, '', 3, 'Vírus 27,88não!,Restos de Nada,Espermogramix,Ulster'),
