(388, 'Mika', '\n                Michael Holbrook Penniman Jr., mais conhecido como Love Today, alcançou 5x Platina no Reino Unido, e 3x Platina nos EUA. Iniciou sua carreira apresentando várias demos para diversas gravadoras, até se firmar na Island Records, em parceria com a Universal Music. \n\n        ', 'http://userserve-ak.last.fm/serve/252/33928427.jpg', 1, '07af613eea059030daaed3bde1fd1ce7', 0, '14404e83-c401-4d4b-bba8-73dac56cb33d', 3, 'Scissor Sisters,fun.,Alphabeat,Adam Lambert,Lily Allen'),
