(390, 'Mika Miko', '\n                Mika Miko é uma banda de funk punk formada no ano de 2003 em Los Angeles, Califórnia. A banda se popularizou rapidamente devido a sua performance frenética em palco.  Tocaram diversas vezes no &quot;The Smell&quot;, um lugar onde punks e straight edges costumavam se encontrar para assistir shows de bandas mais alternativas. No ano de 2008, realizaram uma turnê pela Europa e Japão, e em 2009 decidiram parar de tocar. Mais tarde, duas das ex-integrantes - Jennifer e Jessica Clavin - formaram outra banda chamada &quot;Bleached&quot;. \n\n        ', 'http://userserve-ak.last.fm/serve/252/130872.jpg', 1, '32c1ed2ff8d196c0110c75a9f4fa2674', 0, 'f04f25c4-4b4e-4e5b-93c4-54c193d8f866', 3, 'Grass Widow,PENS,Brilliant Colors,Heavens to Betsy,Colleen Green'),
