(392, 'Mikael Wiehe', '\n                Mikael Wiehe nasceu em Estocolmo, Suécia, em 10/04/1946. Viveu os primeiros anos de sua vida em Copenhagen e, após o divórcio dos pais quando tinha 6 anos, mudou-se com a mãe e o irmão Thomas para Malmö, cidade onde se estabeleceu e à qual seu nome sempre foi ligado.\n Mikael começou sua carreira musical ainda adolescente, tocando saxofone em bandas de jazz. No final dos anos 60 / início dos Anos 70, com o fim da popularidade do jazz na Suécia acaba se voltando ao pop.\n\n        ', 'http://userserve-ak.last.fm/serve/252/201123.jpg', 1, 'b1d7ba9f41658b12d14cd8e308894ef5', 0, '7d40635b-e25d-46ea-88f0-b75677ac1456', 3, 'Hoola Bandoola Band,Björn Afzelius,Stefan Sundström,Nationalteatern,Eldkvarn'),
