(396, 'Lil Jon', '\n                Jonathan Mortimer Smith (nascido em 27 de Janeiro de 1971), mais conhecido como Lil Jon, é um produtor e rapper americano. É mais conhecido como o pioneiro de um sub-gênero do HipHop conhecido como “Crunk” (uma combinação de elementos do Bounce Music, Disco Music, Southern HipHop e Bass Music). Seu grupo, The Eastside Boyz, que inclui Big Sam e Lil Bo, é um dos mais notáveis grupos de crunk. Lil Jon também é um prolífico produtor de outros grupos e frequentemente faz aparições como convidado.    \n\n        ', 'http://userserve-ak.last.fm/serve/252/47409729.jpg', 1, '3a1679275eb9c99863913b4f01c02b56', 0, 'a95384b1-6aec-468c-ae0d-8c6daf87c4c2', 3, 'Lil Jon & The East Side Boyz,Ying Yang Twins,YoungBloodz,Unk,Lil'' Scrappy'),
(397, 'Lil Jon & The East Side Boyz', '\n                Jonathan Mortimer Smith (nascido em 27 de Janeiro de 1971), mais conhecido como Lil Jon, é um produtor e rapper americano. É mais conhecido como o pioneiro de um sub-gênero do HipHop conhecido como &quot;Crunk&quot; (uma combinação  de elementos do Bounce Music, Disco Music, Southern HipHop e Bass Music). Seu grupo, The Eastside Boyz, que inclui Big Sam e Lil Bo, é um dos mais notáveis grupos de crunk. Lil Jon também é um prolífico produtor de outros grupos e frequentemente faz aparições como convidado.   \n\n        ', 'http://userserve-ak.last.fm/serve/252/19062291.jpg', 1, '6a37f3af0a40e3a896d71e49916570ac', 0, '243c6f61-d83b-4459-bebd-5899df0da111', 3, 'Lil Jon,Ying Yang Twins,David Banner,Lil'' Scrappy,Trillville'),
