(400, 'Flo Rida', '\n                Tramar Dillard, mais conhecido como Flo Rida (pronúncia: flow-ry-dah) (16 de Dezembro de 1979, Carol City,Flórida) é um rapper afro-americano. Usa esse nome artístico pelo fato de ter nascido na Flórida e também ao seu estilo de pop rap. Desde 2007, sua tendência foi só evoluir no Hip House até os dias de hoje. Seus singles clássicos são Low(2007), Right Round(2009), Club Can''t Handle Me(2010), Good Feeling(2011), Wild Ones, Whistle and I Cry(2012).\n\n        ', 'http://userserve-ak.last.fm/serve/252/91212969.png', 1, 'f2f99ecc88809ecc22ba05705b3687d1', 0, '02c8c7c3-391e-473d-8403-fe76477b88a9', 3, 'Pitbull,Taio Cruz,Jason Derülo,David Guetta,Sean Kingston'),
