(406, 'Flo Rida feat. Timbaland', '\n                Tramar Dillard, mais conhecido como Flo Rida (Carol City, Flórida, 16 de Dezembro de 1979), é um rapper afro-americano. Usa esse nome artístico pelo fato de ter nascido na Flórida e também ao seu estilo de rap. Estreou com a canção &quot;Bitch I''m From Dade County&quot; do álbum We the Best de DJ Khaled. Começou a aparecer em mixtapes em 2006 e a associar-se com rappers locais como Rick Ross\n\n        Flo Rida feat. Timbaland on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/4564952.jpg', 1, '38d59a38c45eb20c897682f35fc2fb9d', 0, '', 3, 'Flo-Rida Ft. Will.I.Am and Fergie,Flo Rida Feat. Sean Kingston,Akon feat. Kardinal Offishall,Flo Rida feat. Birdman,Ray J Feat. Yung Berg'),
(407, 'Nelly Furtado', '\n                Victoria, British Columbia, Canada (2000 – present)  Nelly Kim Furtado (Victoria, 2 de dezembro de 1978) é uma cantora, compositora, produtora, instrumentista e atriz canadense, filha de emigrantes portugueses, oriundos da freguesia de Ponta Garça, São Miguel, Açores.  Conhecida por sua voz marcante, Nelly ganhou destaque por habilidades únicas no cenário musical. Além de ser triglota -Fluente na língua inglesa, portuguesa e castelhana; tem uma grande influência sobre música étnica e folclórica, tendo experimentado em sua carreira uma grande variedade de sons...\n\n        ', 'http://userserve-ak.last.fm/serve/252/84150863.png', 1, '325dca7d85d2b6a2f09f2486c125e5fc', 0, '13655113-cd16-4b43-9dca-cadbbf26ee05', 3, 'Shakira,Jennifer Lopez,Gwen Stefani,Natasha Bedingfield,Fergie'),
