(412, 'Nelly Furtado featuring Timbaland', '\n                Nelly Kim Furtado (Victoria, 2 de Dezembro de 1978) é uma cantora, compositora e actriz do Canadá filha de emigrantes portugueses.  Entre as suas canções mais bem-sucedidas estão seus dois primeiros singles &quot;I''m Like a Bird&quot; (pelo qual ganhou um Grammy), e os recentes números-um All Good Things &quot;Promiscuous&quot;, &quot;Maneater&quot; e &quot;Say It Right&quot;.\n Filha de imigrantes açorianos, além do inglês ela também fala o português fluentemente [1]. Aprendeu a tocar trombone quando tinha nove anos de idade e o teclado quando tinha onze. Começou a compor as suas próprias canções quando tinha apenas treze anos. \n\n        ', 'http://userserve-ak.last.fm/serve/252/9442027.jpg', 1, '1aa80306e6abbb746cd98b23258eba6c', 0, '', 3, ''),
