(415, 'Black Eyed Peas', '\n                The Black Eyed Peas é uma banda de pop dançante é considerada por muitos a música que reflete os tempos de hoje, sendo considerada o Hino da Atualidade.  \n\n        ', 'http://userserve-ak.last.fm/serve/252/229793.jpg', 1, '1bb4e30465abd30dff5a4f65837908d5', 0, '', 3, 'Fergie,will.i.am,David Guetta,The Pussycat Dolls,Pitbull'),
(416, 'The Black Eyed Peas', '\n                The Black Eyed Peas é uma banda de hip-hop que começou seu trabalho em Los Angeles, EUA, em 1989, e desde então conquistaram muitos ouvintes. Venderam 29 milhões de discos.  Tudo começou, em Los Angeles em 1989, quando apl.de.ap se conheceram na adolescência e fundaram um grupo de dança break, o Tribal Nation.   Depois de um certo tempo, decidiram parar de apenas dançar e começar a cantar.\n\n        ', 'http://userserve-ak.last.fm/serve/252/98344187.png', 1, 'd5239066bb082029d618e435e10e9061', 0, '34545bae-0889-4e3b-8328-d3fbf0cf2fff', 3, ''),
