(430, 'Wiz Khalifa', '\n                Cameron Gabriel Thomaz (nascido em 08 de setembro de 1987), mais conhecido pelo nome artístico de Wiz Khalifa, é um rapper americano com sede em Pittsburgh, Pensilvânia. Ele lançou seu álbum de estréia, Show and Prove, em 2006, e assinou com a Warner Bros Records em 2007. Suas influências techno single, &quot;Say Yeah&quot;, recebeu rádios urbanas, gráficos da Billboard Hot 100, Rhythmic Top 40 e gráficos Hot Rap Tracks em 2008 .\n\n        ', 'http://userserve-ak.last.fm/serve/252/71510270.png', 1, '523d76e60e6a8b5ea23346aca8cfee9f', 0, 'f5dfa020-ad69-41cd-b3d4-fd7af0414e94', 3, 'Snoop Dogg & Wiz Khalifa,Curren$y & Wiz Khalifa,Juicy J,Curren$y,Mac Miller'),
