(438, 'Travie McCoy', '\n                Travis McCoy (nascido em 6 de agosto de 1981) é o principal vocalista da banda de hip hop alternativo Gym Class Heroes.  Travis McCoy fez sua estréia na MTV no verão de 2002 quando apareceu no programa Direct Effect, que era uma batalha de MC''s. Em 1 de julho de 2008 foi preso após agredir um homem na cabeça com um microfone, após uma discussão, em um show em St. Louis, em Missouri. O homem tinha ofendido-o no meio da multidão em um show em St. Louis, chamando de um &quot;negro ignorante de merda&quot;.\n\n        ', 'http://userserve-ak.last.fm/serve/252/53824249.jpg', 1, '8c3c6e48b6d730c8a4bc7020d171b0a2', 0, '76bf7aec-83f0-47a9-8964-eea180b99ac2', 3, 'Gym Class Heroes,Bruno Mars,Iyaz,B.o.B,Flo Rida'),
