(446, 'B.o.B', '\n                Bobby Ray Simmons (nascido em 15 de novembro de 1988),também conhecido como Bobby Ray ou B.o.B, é um cantor, rapper e produtor musical de Atlanta, Geórgia, Estados Unidos. Atualmente está trabalhando com as gravadoras Grand Hustle e Atlantic Records.  Em seu álbum de estréia, B.o.B Presents The Adventures of Bobby Ray, deveria ter sido lançado em 25 de maio de 2010 mas, devido ao sucesso de &quot;Nothin'' on You&quot;, o lançamento foi antecipado para 27 de abril de 2010, o que á muito raro para um álbum debut.\n\n        ', 'http://userserve-ak.last.fm/serve/252/78099202.png', 1, 'd3cdc6f6a64d025d146574d76d47f856', 0, '94c338ff-1985-4429-9dc8-997b61bb5932', 3, 'T.I.,Lupe Fiasco,Kid Ink,DJ Khaled,Chiddy Bang'),
(447, 'B.o.B.', '\n                Bobby Ray Simmons,B.O.B  nascido em 15 de novembro de 1988, em Decatur, Geórgia. Bobby Ray está atualmente assinado sob os rótulos de Grand Hustle e Atlantic Records. Em Dezembro de 2008, ele apareceu na capa da revista XXL juntamente com Asher Roth, Charles Hamilton, e Wale como “Hip-Hop da Classe de’09.” Em Outubro de 2008, B.o.B foi apresentado na capa da revista Vibe, juntamente com alguns desses mesmos jovens músicos e foi também identificado como promissores jovens talentos. Ele descreveu a sua influência como “80’s music, techno, rock, funk, mesmo du WOP .\n\n        B.o.B. on Last.fm.\n    \n    ', 'http://userserve-ak.last.fm/serve/252/15324033.jpg', 1, '4547d1f32e2d02f3ddbf7087a4ddf51e', 0, '168ff238-570b-4bea-875b-821d5f2cfbed', 3, ''),
