(458, 'Katy Perry', '\n                    Katy Perry (nome artístico de Katheryn Elizabeth Hudson, Santa Bárbara, Califórnia — 25 de outubro de 1984) é uma cantora e compositora estadunidense de música POP.  Filha de um casal de pastores evangélicos, começou sua carreira cantando em igrejas e chegou a lançar um álbum de estúdio de música gospel em 2001, intitulado Katy Hudson, mas que teve suas vendas canceladas devido ao fechamento da Red Hill Records, gravadora responsável pela produção do álbum.\n\n        ', 'http://userserve-ak.last.fm/serve/_/103220177/Katy+Perry+Billboard.png', 1, 'a325e51c26bf76de96cf8908e76e8c93', 0, '122d63fc-8671-43e4-9752-34e846d62a9c', 3, 'Ke$ha,Ferras,The Matrix,Selena Gomez,Rihanna,'),
