(462, 'Bob Dylan', '\n                    Robert Allen Zimmerman, mais conhecido como Bob Dylan nasceu em Minnesota no ano de 1941. Aos dez anos de idade Dylan escreveu seus primeiros poemas e, ainda adolescente, aprendeu piano e guitarra sozinho. Começou cantando em grupos de rock, imitando Little Richard e Buddy Holly, mas quando foi para a Universidade de Mineapólis em 1959, voltou-se para a folk music. O primeiro álbum de Dylan foi lançado em 1962 e intitulado&quot;Bob Dylan&quot;.\n\n        ', 'http://userserve-ak.last.fm/serve/_/33184199/Bob+Dylan.jpg', 1, '827efb37d941b6390f6a9217719e95df', 0, '25144665-e9ac-416f-aba3-0c8b4ee547d5', 3, 'Bob Dylan and The Band,Neil Young,The Band,Woody Guthrie,Bruce Springsteen,'),
(463, 'Bob Dylan and The Band', '\n                    A importância de Bob Dylan para o rock deve ser comparada à dos grandes pioneiros como Elvis Presley,  Little Richard. Mesmo não tendo criado grandes inovações, suas letras socialmente conscientes, reflexivas e profundas, influenciaram a mudança do rock de simples música para dançar ao status de expressão artística e instrumento de conscientização.\n Artista revolucionário e merecedor de nosso respeito.\n \n\n        ', 'http://userserve-ak.last.fm/serve/_/53239951/Bob+Dylan+and+The+Band+bdatb.jpg', 1, '22523ef26fdff0d727350075ac7e66b6', 0, '', 3, 'Bob Dylan,The Band,The New Basement Tapes,Van Morrison,Levon Helm,'),
(464, 'Bob Dylan & Johnny Cash', '\n                    De 1969 a 1971 Cash estrelou seu próprio programa televisivo pela rede ABC, que contava com a participação de vários astros da música, como Neil Young e Bob Dylan. Cash apoiava o trabalho de Dylan antes mesmo de conhecê-lo, e os dois tornaram-se amigos depois de morarem na mesma vizinhança de Woodstock, em Nova Iorque, no final dos anos 60. Em complemento às aparições de Dylan em seu programa, Cash gravou um dueto com ele em Nashville Skyline, além de escrever o encarte do álbum vencedor do Grammy. \n\n        ', 'http://userserve-ak.last.fm/serve/_/122256/Bob+Dylan++Johnny+Cash.jpg', 1, 'ed3d6f2f6fa1e1e3411f86e2348abb76', 0, '', 3, 'June Carter Cash,Johnny Cash & June Carter,Johnny Cash & June Carter Cash,The Highwaymen,Johnny Cash,'),
(465, 'Bob Dylan & The Band', '', 'http://userserve-ak.last.fm/serve/_/36204137/Bob+Dylan++The+Band.jpg', 1, '8cf79a28e71c823450fe6f1ae5b7c90e', 0, '', 3, ''),
(466, 'Gangrena Gasosa', '\n                    A Gangrena Gasosa é uma banda peculiar... peculiar e barulhenta! Sarristas ensandecidos, deram um toque brasileiro ao metal do mal! Em vez de entidades nórdicas, demônios abissais e coisas do tipo, o Gangrena traz o Tranca-Rua, o Zé Pelintra, Exu-Caveira e demais entidades que batem ponto (e cabeça) todo dia na encruzilhada mais próxima! \n E foi no inícios dos anos 90, no Rio de Janeiro, que eles fizeram seu primeiro despacho, com o disco &quot;Welcome to Terreiro&quot;, com clássicos instantâneos como &quot;Pegue Santo or Die!&quot;, &quot;Troops of Olodum&quot; e &quot;Exu Noise Terror&quot;.\n\n        ', 'http://userserve-ak.last.fm/serve/500/73724768/Gangrena+Gasosa.png', 1, '07910bf52b3d9bc7d301a8e5020d7e6b', 0, '21382d3d-258b-4cae-ae73-fe2d2a1e9ccf', 3, 'Claustrofobia,DFC,Ratos de Porão,U.D.R.,Korzus,'),
