(468, 'Troops of Olodum / Gangrena Gasosa', '', '', 1, '41d6b1e48ec2ae0c20db9d2c51b480f3', 0, '', 3, ''),
(469, 'Tim Maia', '\n                    Sebastião Rodrigues Maia, mais conhecido como Tim Maia, (Rio de Janeiro, 28 de setembro de 1942 — 15 de março de 1998), é um dos cantores brasileiros mais queridos do público e da classe artística. Começou a compor suas primeiras melodias ainda criança e já surpreendia a numerosa família de 19 irmãos.  Se destacou pelo pioneirismo em trazer para a mpb o estilo soul de cantar. Com a sua voz carregada, tornou-se um dos grandes nomes da música brasileira, vendendo vários discos e emplacando vários sucessos, lembrados até hoje, e que influenciaram até o seu sobrinho, o também cantor Ed Motta. \n\n        ', 'http://userserve-ak.last.fm/serve/500/6657367/Tim+Maia+++1972.jpg', 1, 'a07b808ce0c399f58db31dfb9e01a780', 0, '446ac261-09ae-43f4-a7e1-2c753c0813ce', 3, 'Jorge Ben,Belchior,Cartola,Erasmo Carlos,Gilberto Gil,'),
