(473, 'Rihanna', '\n                    Robyn Rihanna Fenty, mundialmente conhecida como Rihanna, é uma cantora, atriz e produtora nascida em Saint Michael, Barbados (20 de Fevereiro de 1988). Já vendeu mais de 80 milhões de álbuns e singles, mostrando que veio para ficar. Dona de estrondosos hits mundiais, emplacou 13 deles no Topo da Billboard Hot 100 – S.O.S, Umbrella (feat. Jay-Z), Take a Bow, Disturbia, Live Your Life, Rude Boy, Love The Way You Lie, Only Girl (In the World), Whats My Name? (feat Drake), S&amp;M, We Found Love e Diamonds – sendo a artista feminina com mais #1 desde o início da década de 2000 e do século XXI.\n\n        ', 'http://userserve-ak.last.fm/serve/_/90341421/Rihanna+riri.png', 1, '0588499a7fadc0d74996e5c65a6624c3', 0, '69989475-2971-49aa-8c53-5d74af88b8be', 3, 'Nicki Minaj,Beyoncé,Jessie J,Rita Ora,Ciara,'),
