(475, 'T.I. feat. Rihanna', '\n                    Rihanna fez uma participacao no novo album do T.I., Paper Trails. A parceria resultou na musica Live Your Life que deve ser apresentada no VMA no dia 7 de setembro. O curioso é que a musica é uma versão da musica da banda O-zone, Dragostea Din Tai.\n \n\n        T.I. feat. Rihanna on Last.fm.\n    \n    \nUser-contributed text is available under the Creative Commons By-SA License and may also be available under the GNU FDL.\n    ', 'http://userserve-ak.last.fm/serve/_/33818321/TI+feat+Rihanna+TIRihannaMTV_l.jpg', 1, '3cf6391621ac1bc2c663e0ce3fa0679c', 0, '', 3, 'T.I. feat. Justin Timberlake,Jay-Z feat. Rihanna & Kanye West,Flo Rida feat. T-Pain,Jay-Z Feat. Alicia Keys,David Guetta Feat. Rihanna,'),
