(477, 'Martinho Da Vila', '\n                    Martinho José Ferreira (Duas Barras, 12 de fevereiro de 1938) é um cantor, compositor, escritor e músico brasileiro.  A carreira artística surgiu para o grande público no III Festival da Record, em 1967, quando concorreu com a música &quot;Menina Moça&quot;. O sucesso veio no ano seguinte, na quarta edição do mesmo festival, lançando a canção &quot;Casa de Bamba&quot;, um dos clássicos de Martinho. O primeiro álbum, lançado em 1969, intitulado Martinho da Vila...\n\n        ', 'http://userserve-ak.last.fm/serve/500/23658293/Martinho+Da+Vila+MartinhodaVila.jpg', 1, '0bc1f361e58d9173794b004cef53d6fe', 0, '88a13d24-7915-4b51-8d95-c8de00ab79ea', 3, 'Zeca Pagodinho,Beth Carvalho,Jorge Aragão,João Nogueira,Paulinho Da Viola,'),
