(480, 'Bezerra da Silva', '\n                    Pernambucano de Recife, desde sua infância foi ligado à música e sempre &quot;sentiu&quot; que apresentava o dom de tocar, causando atritos com a família.  Seu pai, da Marinha Mercante, saiu de casa quando Bezerra era pequeno, vindo morar no Rio de Janeiro. Com isso, depois de ingressar e ser expulso da Marinha Mercante, descobriu o paradeiro do pai e veio atrás dele. Causando mais atritos com o pai, foi morar sozinho, no Morro do Cantagalo, trabalhando como pintor na construção civil.\n\n        ', 'http://userserve-ak.last.fm/serve/500/47748251/Bezerra+da+Silva+bezerra.jpg', 1, 'a758035561bac0156919254c3966241d', 0, '2d5347a5-ba26-4116-a8e2-c67c61923538', 3, 'Zeca Pagodinho,Martinho Da Vila,Adoniran Barbosa,Os Originais Do Samba,João Nogueira,'),
