(482, 'Bezerra Da Silva, Dicro', '', '', 1, '31e30a5281b7c4dbd06f439461e296fd', 0, '', 3, ''),
(483, 'Bezerra Da Silva Dicro', '', '', 1, '0a35d9c3887a9a909c30be7ede6c83df', 0, '8a4ea91d-f004-4ca5-8747-be41e1bc53f1', 3, 'Azor Delegado,Conjunto Raul de Barros,Mart''nália,Conjunto Escrete do Samba,Seu Jorge,'),
(484, 'Zeca Pagodinho', '\n                    Zeca Pagodinho, nome artístico de Jessé Gomes da Silva Filho, (Rio de Janeiro, 4 de fevereiro de 1959) é um cantor e compositor brasileiro, filho de Iréia e Jessé.  Sua primeira gravação foi em 1981, com a canção &quot;Camarão que dorme a onda leva&quot;, de sua autoria e de Arlindo Cruz, a partir do convite de sua madrinha Beth Carvalho.  Desde então, Zeca já gravou 22 discos e é considerado um grande nome do samba.  \n\n        ', 'http://userserve-ak.last.fm/serve/_/48006619/Zeca+Pagodinho.jpg', 1, 'd78e3c6f426c234b2bbfddb8d723b64a', 0, '37414858-f95d-4c21-aec0-c395ff50fccf', 3, 'Fundo de Quintal,Jorge Aragão,Beth Carvalho,Martinho Da Vila,Arlindo Cruz,'),
(485, 'O Rappa e Zeca Pagodinho', '', '', 1, '5e792b439dd5a3481a20a35c1cbf8b3b', 0, '', 3, 'O Rappa e Marcelo D2,O Rappa [www.sekelado.zip.net],Marcelo D2, Zeca Pagodinho e Arlindo Cruz,Lenine e Marcelo D2,MC Sapão,'),
(486, 'Zéca Pagodinho', '\n                    Zeca Pagodinho, nome artístico de Jessé Gomes da Silva Filho, (Rio de Janeiro, 4 de fevereiro de 1959) é um cantor e compositor brasileiro, filho de Iréia e Jessé.  Sua primeira gravação foi em 1981, com a canção &quot;Camarão que dorme a onda leva&quot;, de sua autoria e de Arlindo Cruz, a partir do convite de sua madrinha Beth Carvalho.  Desde então, Zeca já gravou mais de 18 discos e é considerado um grande nome do gênero samba e pagode.\n\n        ', 'http://userserve-ak.last.fm/serve/_/36917693/Zca+Pagodinho+zeca_pagodinho.jpg', 1, '291e05f5f1bad9891a7240aff4752886', 0, '', 3, 'Projeto Vinagrete,Zeca Pagodinho,Leandro Sapucahy,Beth Carvalho e Hamilton de Hollanda,Julia Fischer; Yakov Kreizberg  Russian National Orchestra,'),
(487, 'Seu Jorge', '\n                    O cantor, compositor e ator Jorge Mário da Silva, o Seu Jorge, nasceu em 8 de junho de 1970, em Belford Roxo, Baixada Fluminense (Rio de Janeiro, Brasil). Primogênito de quatro filhos, Seu Jorge teve uma infância tranqüila, freqüentando a escola e ajudando a mãe a tomar conta dos irmãos. Começou a trabalhar com apenas dez anos de idade em uma borracharia, primeira de várias ocupações como contínuo, marceneiro e office-boy, entre outras.\n\n        ', 'http://userserve-ak.last.fm/serve/_/36599403/Seu+Jorge.png', 1, '59acdadab63ba26aa1ba619936716f2e', 0, 'c73d651d-87c9-4c5e-8abb-4ec9c4077241', 3, 'Ana Carolina & Seu Jorge,Zeca Pagodinho,Diogo Nogueira,Jorge Ben,Seu Jorge & Almaz,'),
(488, 'Ana Carolina E Seu Jorge', '\n                    Celebrando o grande sucesso de Estampado, Ana Carolina lança Ana &amp; Jorge, o álbum que registra um show que a cantora fez em parceria com o cantor Seu Jorge em agosto de 2005, em São Paulo. Uma apresentação belíssima em formato acústico, possibilitando que os dois mostrassem suas canções de uma forma mais próxima à maneira como foram criadas. O repertório inclui &quot;É Isso Aí&quot;, uma versão de Ana para &quot;Blower''s Daughter&quot; (Damien Rice), do filme Closer, canções das carreiras solo de ambos e dois textos de Elisa Lucinda, musicados pela dupla: &quot;Só de Sacanagem&quot; e &quot;Alfredo é Gisele&quot;. \n\n        ', 'http://userserve-ak.last.fm/serve/_/14372/Ana+Carolina+E+Seu+Jorge.jpg', 1, '56bf4f77c96aa1a7fbf7c72db80f9321', 0, '', 3, ''),
(489, 'Racionais Mc´s', '\n                    Um dos principais grupos de rap e hip hop brasileiros, surgiu no final da década de 80 na periferia de São Paulo com um discurso contra a opressão às populações marginalizadas nas grandes metrópoles brasileiras. A primeira gravação foi em 1988, na coletânea &quot;Consciência Black&quot;. Dois anos depois, o primeiro disco solo, &quot;Holocausto Urbano&quot; levou o grupo a fazer uma série de shows pela Grande São Paulo, tornando-o mais conhecido.\n\n        ', 'http://userserve-ak.last.fm/serve/_/309651/Racionais+Mcs.jpg', 1, '467c05b0235f0141aba6845b6dc2543b', 0, '', 3, 'Racionais Mc''s,Sabotage,Realidade Cruel,Facção Central,MV Bill,'),
(490, 'Johann Sebastian Bach', '\n                    Johann Sebastian Bach, (31 de Março de 1685 (21 de Março no calendário Juliano) - 28 de Julho de 1750)  foi um músico e compositor do período barroco da música erudita. Foi também um organista notável. Nasceu em Eisenach, Alemanha, no seio de uma família de músicos. É considerado um dos maiores e mais influentes compositores da história da música, ainda que pouco reconhecido na altura em que viveu.\n\n        ', 'http://userserve-ak.last.fm/serve/_/70999994/Johann+Sebastian+Bach+JohannSebastianBachBETTERQUALI.png', 1, '698c1236f839841d4f25d51a40ea975b', 0, '24f1766e-9635-4d58-a4d4-9413f9f98a4c', 3, 'Ludwig van Beethoven,Georg Friedrich Händel,Wolfgang Amadeus Mozart,Franz Schubert,Franz Joseph Haydn,'),
(491, 'Johann Sebastian Bach Orchestra', '', 'http://userserve-ak.last.fm/serve/_/99038327/Johann+Sebastian+Bach+Orchestra+album.jpg', 1, '2d0f70cde0a7dd8ed445c51457efe31b', 0, '', 3, 'Fabrizio von Arx,Oliver Schnyder,J.S. Bach Orchestra,Debussy Consort,Vivaldi String Orchestra & Walter Rinaldi,'),
(492, 'Bach, Johann Sebastian [Composer]', '', 'http://userserve-ak.last.fm/serve/_/91604763/Bach+Johann+Sebastian+Composer+00_lastfm_bad.png', 1, '919ea4c7b313703f36be247e8d0495c7', 0, '', 3, 'Vivaldi, Antonio [composer],Handel, George Frideric [Composer],Chopin, Frédéric [Composer],Elgar, Sir Edward [Composer],Ravel, Maurice [Composer],'),
(493, 'Johann Sebastian Bach (Иоганн Себастьян Бах)', '', 'http://userserve-ak.last.fm/serve/_/51645849/Johann+Sebastian+Bach++++00_lastfm_bad_tag.png', 1, '7937c0ec08b4ef3ae0dd39c304e1baed', 0, '', 3, 'Johann Sebastian Bach (Иоган Себастьян Бах),И.С. Бах (Мечислав Хоржовский - рояль, 1983 г.),Сальваторе Аккардо,Бах Иоганн Себастьян [club13333245],Bach, Johann Sebastian (Bell`Arte Ensemble),'),
(494, 'Wolfgang Amadeus Mozart', '\n                    Wolfgang Amadeus Mozart (Salzburgo, 27 de Janeiro de 1756 — Viena, 5 de Dezembro de 1791) foi um dos maiores compositores de música erudita de todos os tempos. Seu estilo inconfundível o torna sem sombra de dúvidas um dos dos melhores no segmento. Autodidata, começou aos 5 anos a escrever pequenos duetos e composições para piano. Mozart mergulhou todo o seu talento na vastidão desse mundo tão exigente que é o erudismo. Em 1782 casa, contra a vontade do pai, com Constanze Weber. Apesar de fazer sucesso em muitas capitais da Europa, Mozart não gozava de muito prestígio em Viena, onde vivia.\n\n        ', 'http://userserve-ak.last.fm/serve/500/85563769/Wolfgang+Amadeus+Mozart+PNG.png', 1, 'c14836d13d50b5461c240759ed425af2', 0, '255b884c-25e9-4da2-99e9-b104ed637eae', 3, 'Ludwig van Beethoven,Johann Sebastian Bach,Franz Joseph Haydn,Antonio Vivaldi,Georg Friedrich Händel,'),
(495, 'Mozart Season', '\n                    Com quase cinco anos de experiência por trás deles, Estação de Sacramento Mozart já construiu um exército de seguidores dedicados e afiou sua assinatura sonora da pesada, melodias escuras misturadas com instrumentais agressivos, vocais surra e um pouco de refrões estilo pop-punk.\n Nate Rocha (vocal), Benton Christensen (guitarra), Sam Trux (guitarra), Troy Cooper (baixo) e Lucas Allen (bateria) mostram a maturidade além de seus anos como eles produzem conjuntamente inovadoras melódica, a música de post-hardcore em seus pesadelos lançamento.\n \n\n        Mozart Season on Last.fm.\n    \n    \nUser-contributed text is available under the Creative Commons By-SA License and may also be available under the GNU FDL.\n    ', 'http://userserve-ak.last.fm/serve/500/54482399/Mozart+Season+Corinne+Buchanan2.jpg', 1, '9dbd1920f729920b30e1802b4ed6c0ff', 0, '0292f3eb-c730-495d-a796-80df155c5d45', 3, 'Tonight Is Glory,Dear Whoever,A Thorn For Every Heart,Four Letter Lie,Across Five Aprils,'),
(496, 'Mozart Festival Orchestra', '', 'http://userserve-ak.last.fm/serve/_/5263786/Mozart+Festival+Orchestra+fourseasons_review_body_300x22.jpg', 1, 'f99e4e73aaf5e843d251a76c18e6e27f', 0, '28ab3f3f-8cdb-43ba-bd93-57b46f65beff', 3, 'Capella Istropolitana,Walter Klien,Philharmonia Slavonica,Sylvia Capova,Peter Schmalfuss,'),
(497, 'José Carreras;Placido Domingo;Luciano Pavarotti', '', '', 1, 'ef2c984112bd0d091a72def504983bf3', 0, '', 3, 'Placido Domingo;Luciano Pavarotti,Choir of King''s College, Cambridge/Ian Hare/Sir David Willcocks,Anthony Crossland,José Carreras;Placido Domingo,Choir of King''s College, Cambridge/Sir David Willcocks,'),
(498, 'Kiri Te Kanawa,Luciano Pavarotti', '', '', 1, '6d9acd1645beae4537392f9610f978c8', 0, '', 3, 'June Anderson, Luciano Pavarotti,Joan Sutherland, Jane Berbie,Joan Sutherland, Marilyn Horne,Bartoli (Cenerentola),Helge Roswaenge,');
INSERT INTO `Artista` (`ArtistaId`, `Titulo`, `Descricao`, `Imagem`, `Ativo`, `md5`, `Visitas`, `mbid`, `AplicacaoId`, `Relacionados`) VALUES
(499, 'Trilha Sonora do Gueto', '\n                    Trilha Sonora do Gueto, também conhecido somente como T$G é um grupo de rap brasileiro. Formado em 1998, sofreu diversas reformulações no conjunto, e possui Dijalma Oliveira Rios, mais conhecido como Cascão, como líder. Já lançou três álbuns e um DVD. Um fato interessante é que o nome dos álbuns utilizam linguagem coloquial e gírias.  O grupo surgiu em 1998, com os integrantes Cascão, Bokão e Véio, oriundos do bairro Capão Redondo.\n \n\n        ', 'http://userserve-ak.last.fm/serve/_/59476311/Trilha+Sonora+do+Gueto+0.jpg', 1, '71591aef122dd1f545b5de832919223b', 0, 'd45a667c-773b-43b6-b55a-fda29d766992', 3, 'Realidade Cruel,Snj,Facção Central,RZO,509-E,'),
(500, 'Trilha Sonora do Gueto -', '', '', 1, '9e0180d6bc76238589bf70a4e52da61f', 0, '', 3, ''),
(501, 'Ao Cubo Part. Trilha Sonora do Gueto', '', '', 1, 'e866242c3255eef5d5af40cec92cce71', 0, '', 3, 'Expressão Ativa,Conexão Do Morro,Doctor MC''s,www.FunkNeurotico.net,DBS e a Quadrilha,'),
(502, 'Ao Cubo & Trilha Sonora do Gueto', '', '', 1, 'ccf2c71996ace4914b9fe06442c7a70e', 0, '', 3, 'A Família'),
(503, 'Realidade Cruel', '\n                    Realidade Cruel, grupo do interior paulista, cidade de Hortolândia, formado em 1992 por Douglas, DJ Bolha, Minho e Moicano. Esta 1ª formação durou até o verão de 93, quando Minho e Moicano se desligaram do grupo por razões pessoais.  O grupo então parou suas atividades até o início de 94, retornando já com a 2ª formação: Keno, DJ Bolha e Douglas, a qual se estabeleceu até meados de 98.  Nesse meio tempo, entre 94 e 98, o grupo realizava apresentações em eventos espalhados nas cidades do interior.\n\n        ', 'http://userserve-ak.last.fm/serve/_/93262557/Realidade+Cruel+++2013.png', 1, 'a24eedb6cd22f9c59ee672b977802f72', 0, '3a974710-3f3c-46bc-a086-2567c47cc3a9', 3, 'Detentos do Rap,Facção Central,Consciência Humana,Trilha Sonora do Gueto,Face Da Morte,'),
(504, 'realidade cruél', '', '', 1, 'a925bdaeeaf3e05c5ac4d77fcff73061', 0, '', 3, ''),
(505, 'Douglas Realidade Cruel', '', '', 1, '6c5da189a0850e73087ddf7b67a1bbc5', 0, '', 3, 'Gög,Helião,Visáo De Rua,Possemente Zulu,Código Fatal,'),
(506, 'DBS/Douglas (Realidade Cruel)', '', '', 1, 'af81cf8a7095631393f4556f89f9a3a9', 0, '', 3, 'DBS/Túlio Deck,DBS/Tribo de Jah/Rael,DBS/Hélião/Ice Blue,DBS/Projota/Terra Preta,DBS/Black Alien/Edi Rock,'),
(507, 'Facção Central', '\n                    O grupo foi formado em 1989, na região central de São Paulo (Glicério, Cambuci e Ipiranga), sendo inicialmente integrado por Nego (hoje conhecido como Rapper Mag), Eduardo e Jurandir. Nego e Jurandir deixaram o grupo, sendo substituídos por Dum Dum e Garga, que se juntaram a Eduardo e iniciaram as atividades do grupo.  De 1997 para 1998 Garga saiu do grupo e Erick 12 chegou para somar, mas em seguida deixou o Facção Central (FC) e hoje apenas produz o grupo.  \n\n        ', 'http://userserve-ak.last.fm/serve/500/89076011/Faco+Central+Faco.jpg', 1, 'd233c5e0db1eb2d448d978daaa8f4969', 0, '748cba7b-d64b-48df-a983-7bbc3493455e', 3, 'Realidade Cruel,Detentos do Rap,Consciência Humana,Trilha Sonora do Gueto,Sabotage,'),
(508, 'Facção Central/Faccao Central', '', '', 1, 'b10dac8d9ea080dff98dfae7fcd3aa86', 0, '', 3, ''),
(509, 'Facção Central/Facção Central', '', '', 1, 'ee21afd50c6c57c5ca924422fb624b0b', 0, '', 3, ''),
(510, 'Icona Pop', '\n                    Icona Pop é um duo de electro-pop da Suécia formado por Caroline Hjelt e Aino Jawo.  Elas se popularizaram rápido pela internet com a música &quot;Manners&quot;, carro chefe de seu primeiro EP, lançado em 2011. Lançaram em Maio de 2012 o tema &quot;I Love It&quot; com a cantora britânica Charli XCX, que se tornou um sucesso, tornando-se no genérico e fazendo parte da banda sonora de alguns programas da MTV. Esta fez também parte da lista das 50 melhores músicas de 2012 ficando no número 35. I Love It já pode ser considerado um dos grandes hits do mercado americano e possivelmente um grande hit de 2013 no mundo.\n\n        ', 'http://userserve-ak.last.fm/serve/_/86533035/Icona+Pop.png', 1, '15270701fccef2e2b3a1d818eef934b4', 0, 'c5f259d0-abd8-418e-81ee-3965fd4e4e9a', 3, 'Havana Brown,Natalia Kills,Ke$ha,Charli XCX,Foxes,'),
(511, 'Logo X Icona Pop', '', 'http://userserve-ak.last.fm/serve/_/63317663/Logo+X+Icona+Pop.jpg', 1, '7ddff51be9675437c517bde3f2e24e01', 0, '', 3, 'Alexander Dexter Jones,Gallop,Justus Kohncke with Alexis Taylor,…,VAllEY,'),
(512, 'Icona Pop (feat. Charli XCX)', '', 'http://userserve-ak.last.fm/serve/500/95852033/Icona+Pop+feat+Charli+XCX+20120814+145651.jpg', 1, '4282e16068b54d7f5e98f3862ba70d3b', 0, '', 3, 'Flo Rida feat. Pibull,DJ Gollum (feat. Scarlet),Avicii (feat. Aloe Blacc),Robin Thicke (Feat. T.I. & Pharrell),Daft Punk (Feat. Pharrell Williams),'),
(513, 'Chiddy Bang feat. Icona Pop', '', 'http://userserve-ak.last.fm/serve/_/94443969/Chiddy+Bang+feat+Icona+Pop+cover48.jpg', 1, '30cf8fdb4b39de99d322b4bd28166dbd', 0, '', 3, 'Chiddy Bang feat. Shirazi,Chiddy Bang Feat. Gordon Voidwell,Unknown Soundcloud Artist,Zion I Feat. K.Flay,The Knocks ft Mandy Lee,');
